member.example:
This sample shows how to call DefaultAsync with required parameters.

var client = new DatetimeClient().GetQueryClient("1.0.0");

Response response = await client.DefaultAsync(DateTimeOffset.UtcNow).ConfigureAwait(false);
Console.WriteLine(response.Status);

This sample shows how to call Default with required parameters.

var client = new DatetimeClient().GetQueryClient("1.0.0");

Response response = client.Default(DateTimeOffset.UtcNow);
Console.WriteLine(response.Status);

